// SPDX-License-Identifier: MIT
pragma solidity ^0.8.15;

import "@openzeppelin/contracts/access/AccessControl.sol";

contract SmartphoneEWasteTracking is AccessControl {

    // Define roles
    bytes32 public constant MANUFACTURER_ROLE = keccak256("MANUFACTURER_ROLE");
    bytes32 public constant DISTRIBUTOR_ROLE = keccak256("DISTRIBUTOR_ROLE");
    bytes32 public constant RETAILER_ROLE = keccak256("RETAILER_ROLE");
    bytes32 public constant CONSUMER_ROLE = keccak256("CONSUMER_ROLE");
    bytes32 public constant REFURBISHER_ROLE = keccak256("REFURBISHER_ROLE");
    bytes32 public constant RECYCLER_ROLE = keccak256("RECYCLER_ROLE");
    bytes32 public constant ENVIRONMENT_ROLE = keccak256("ENVIRONMENT_ROLE");
    bytes32 public constant GOVERNMENT_ROLE = keccak256("GOVERNMENT_ROLE");

    struct Component {
        string componentName;
        string material;
        bool isHazardous;
    }

    struct LifecycleEvent {
        string eventDescription;
        uint256 timestamp;
    }

    struct DisposalEvent {
        string disposalMethod;
        string disposalDate;
        string location;
        string disposedBy;
    }

    struct EWastePassport {
        string smartphoneModel;
        string manufacturer;
        uint256 imeiNumber;
        uint256 manufactureDate;
        uint256 expectedLifecycle;
        bool isBatteryReplaceable;
        Component[] components;
        LifecycleEvent[] lifecycleEvents;
        DisposalEvent disposalEvent;
    }

    mapping(uint256 => EWastePassport) public passports;

    constructor() public {
        _setupRole(AccessControl.DEFAULT_ADMIN_ROLE, msg.sender);  // Set deployer as the default admin
        _setupRole(MANUFACTURER_ROLE, msg.sender);
        _setupRole(DISTRIBUTOR_ROLE, msg.sender);
        _setupRole(RETAILER_ROLE, msg.sender);
        _setupRole( CONSUMER_ROLE, msg.sender);
        _setupRole( REFURBISHER_ROLE, msg.sender);
        _setupRole( RECYCLER_ROLE, msg.sender);
        _setupRole( ENVIRONMENT_ROLE, msg.sender);
        _setupRole( GOVERNMENT_ROLE, msg.sender);

    }

    function createNewPassport(
        uint256 _imeiNumber,
        string memory _smartphoneModel,
        string memory _manufacturer,
        uint256 _expectedLifecycle,
        uint256 _manufactureDate,
        bool _isBatteryReplaceable
    ) public {
        require(hasRole(MANUFACTURER_ROLE, msg.sender), "Unauthorized!");
        require(passports[_imeiNumber].imeiNumber != _imeiNumber, "IMEI already exists!");

        EWastePassport storage newPassport = passports[_imeiNumber];
        
        newPassport.smartphoneModel = _smartphoneModel;
        newPassport.manufacturer = _manufacturer;
        newPassport.imeiNumber = _imeiNumber;
        newPassport.manufactureDate = _manufactureDate;
        newPassport.expectedLifecycle = _expectedLifecycle;
        newPassport.isBatteryReplaceable = _isBatteryReplaceable;
        newPassport.disposalEvent = DisposalEvent("", "", "", "");
    }

    function manufacturerTransaction(
        uint256 _imeiNumber,
        uint8 actionType,
        address entityAddress,        
        string memory smartphoneDetails, 
        string memory additionalInfo,  
        string memory disposalMethod,
        string memory disposalDate,
        string memory location
    ) public {
        require(hasRole(MANUFACTURER_ROLE, msg.sender), "Unauthorized!");
        require(passports[_imeiNumber].imeiNumber == _imeiNumber, "IMEI does not exist!");

        string memory eventDescription;

        if (actionType == 1) {
            eventDescription = string(abi.encodePacked(
                "Action: Sold to Distributor",
                "\nEntity Address: ", addressToString(entityAddress),
                "\nSmartphone Details: ", smartphoneDetails,
                "\nAdditional Info: ", additionalInfo
            ));
        } else if (actionType == 2) {
            eventDescription = string(abi.encodePacked(
                "Action: Sold to Retailer",
                "\nEntity Address: ", addressToString(entityAddress),
                "\nSmartphone Details: ", smartphoneDetails,
                "\nAdditional Info: ", additionalInfo
            ));
        } else if (actionType == 3) {
            eventDescription = string(abi.encodePacked(
                "Action: Sold to Consumer",
                "\nEntity Address: ", addressToString(entityAddress),
                "\nSmartphone Details: ", smartphoneDetails,
                "\nAdditional Info: ", additionalInfo
            ));
        } else if (actionType == 4) {
            eventDescription = string(abi.encodePacked(
                "Action: Give to Recycler",
                "\nEntity Address: ", addressToString(entityAddress),
                "\nSmartphone Details: ", smartphoneDetails,
                "\nAdditional Info: ", additionalInfo
            ));
        } else if (actionType == 5) {
            // Calling the disposeDevice method when actionType is 5
            disposeDevice(_imeiNumber, disposalMethod, disposalDate, location, addressToString(msg.sender));
        } else {
            revert("Invalid transaction type");
        }

        LifecycleEvent memory newEvent = LifecycleEvent({
            eventDescription: eventDescription,
            timestamp: block.timestamp
        });

        passports[_imeiNumber].lifecycleEvents.push(newEvent);
    }

    // Implementing the disposeDevice method
    function disposeDevice(
        uint256 _imeiNumber,
        string memory _disposalMethod,
        string memory _disposalDate,
        string memory _location,
        string memory _disposedBy
    ) internal {  // Set to internal as it should only be called from within this contract
        require(passports[_imeiNumber].imeiNumber == _imeiNumber, "IMEI does not exist!");
        passports[_imeiNumber].disposalEvent.disposalMethod = _disposalMethod;
        passports[_imeiNumber].disposalEvent.disposalDate = _disposalDate;
        passports[_imeiNumber].disposalEvent.location = _location;
        passports[_imeiNumber].disposalEvent.disposedBy = _disposedBy;
    }

    // Helper function to convert address to string (useful for logging in eventDescription)
    function addressToString(address _address) private pure returns(string memory) {
        bytes32 value = bytes32(uint256(uint160(_address)));
        bytes memory alphabet = "0123456789abcdef";
        
        bytes memory str = new bytes(42);
        str[0] = '0';
        str[1] = 'x';
        for (uint256 i = 0; i < 20; i++) {
            str[2 + i * 2] = alphabet[uint8(value[i + 12] >> 4)];
            str[3 + i * 2] = alphabet[uint8(value[i + 12] & 0x0f)];
        }
        return string(str);
    }


    function consumerTransaction(
        uint256 _imeiNumber,
        uint8 actionType, // 1 for Return, 2 for Sell to Refurbisher, 3 for Give to Recycler, 4 for Dispose
        address entityAddress,  // Address of manufacturer, refurbisher, or recycler.
        string memory additionalInfo,  // Additional info, e.g., reasons for return, sale details, etc.
        string memory smartphoneDetails,
        string memory disposalMethod,
        string memory disposalDate,
        string memory location 
    ) public {
        require(hasRole(CONSUMER_ROLE, msg.sender), "Unauthorized!");
        require(passports[_imeiNumber].imeiNumber == _imeiNumber, "IMEI does not exist!");

        string memory eventDescription;
        
        if (actionType == 1) {
            eventDescription = string(abi.encodePacked(
                "Action: Returned to Manufacturer",
                "\nEntity Address: ", addressToString(entityAddress),
                "\nSmartphone Details: ", smartphoneDetails,
                "\nAdditional Info: ", additionalInfo
            ));
        } else if (actionType == 2) {
            eventDescription = string(abi.encodePacked(
                "Action: Sold to Refurbisher",
                "\nEntity Address: ", addressToString(entityAddress),
                "\nSmartphone Details: ", smartphoneDetails,
                "\nAdditional Info: ", additionalInfo
            ));
        } else if (actionType == 3) {
            eventDescription = string(abi.encodePacked(
                "Action: Given to Recycler",
                "\nEntity Address: ", addressToString(entityAddress),
                "\nSmartphone Details: ", smartphoneDetails,
                "\nAdditional Info: ", additionalInfo
            ));
        } else if (actionType == 4) {
            disposeDevice(_imeiNumber, disposalMethod, disposalDate, location, addressToString(msg.sender));
        } else {
            revert("Invalid Action Type!");
        }

        LifecycleEvent memory newEvent = LifecycleEvent({
            eventDescription: eventDescription,
            timestamp: block.timestamp
        });
        passports[_imeiNumber].lifecycleEvents.push(newEvent);
    }


    function refurbisherTransaction(
        uint256 _imeiNumber,
        uint8 actionType, // 1 for Sell to Consumer, 2 for Sell to Retailer, 3 for Give to Recycle, 4 for Dispose
        address entityAddress,  // Address of consumer, retailer, or recycler.
        string memory additionalInfo,  // Additional info, e.g., sale details, reasons, etc.
        string memory smartphoneDetails,
        string memory disposalMethod,
        string memory disposalDate,
        string memory location
    ) public {
        require(hasRole(REFURBISHER_ROLE, msg.sender), "Unauthorized!");
        require(passports[_imeiNumber].imeiNumber == _imeiNumber, "IMEI does not exist!");

        string memory eventDescription;

        if (actionType == 1) {
            eventDescription = string(abi.encodePacked(
                "Action: Sold to Consumer",
                "\nEntity Address: ", addressToString(entityAddress),
                "\nSmartphone Details: ", smartphoneDetails,
                "\nAdditional Info: ", additionalInfo
            ));
        } else if (actionType == 2) {
            eventDescription = string(abi.encodePacked(
                "Action: Sold to Retailer",
                "\nEntity Address: ", addressToString(entityAddress),
                "\nSmartphone Details: ", smartphoneDetails,
                "\nAdditional Info: ", additionalInfo
            ));
        } else if (actionType == 3) {
            eventDescription = string(abi.encodePacked(
                "Action: Given to Recycler",
                "\nEntity Address: ", addressToString(entityAddress),
                "\nSmartphone Details: ", smartphoneDetails,
                "\nAdditional Info: ", additionalInfo
            ));
        } else if (actionType == 4) {

            disposeDevice(_imeiNumber, disposalMethod, disposalDate, location, addressToString(msg.sender));
        } else {
            revert("Invalid Action Type!");
        }

        LifecycleEvent memory newEvent = LifecycleEvent({
            eventDescription: eventDescription,
            timestamp: block.timestamp
        });
        passports[_imeiNumber].lifecycleEvents.push(newEvent);
    }


    function recyclerTransaction(uint256 _imeiNumber, string memory _disposalMethod, string memory _disposalDate, string memory _location) public {
        require(hasRole(RECYCLER_ROLE, msg.sender), "Unauthorized!");
        DisposalEvent memory newDisposal = DisposalEvent({
            disposalMethod: _disposalMethod,
            disposalDate: _disposalDate,
            location: _location,
            disposedBy: addressToString(msg.sender)
        });
        passports[_imeiNumber].disposalEvent = newDisposal;
    }


    function distributorTransaction(
        uint256 _imeiNumber,
        address retailerAddress,  // Address of the retailer the distributor is selling to
        string memory smartphoneDetails,  // Details about the smartphone, like color, variant, etc.
        string memory additionalInfo  // Additional info for transaction, such as transaction ID or batch number
    ) public {
        require(hasRole(DISTRIBUTOR_ROLE, msg.sender), "Unauthorized!");
        require(passports[_imeiNumber].imeiNumber == _imeiNumber, "IMEI does not exist!");

        string memory eventDescription = string(abi.encodePacked(
            "Transaction Type: Sold to Retailer",
            "\nRetailer Address: ", addressToString(retailerAddress),
            "\nSmartphone Details: ", smartphoneDetails,
            "\nAdditional Info: ", additionalInfo
        ));

        LifecycleEvent memory newEvent = LifecycleEvent({
            eventDescription: eventDescription,
            timestamp: block.timestamp
        });

        passports[_imeiNumber].lifecycleEvents.push(newEvent);
    }

    function retailerTransaction(
        uint256 _imeiNumber,
        address consumerAddress,  // Address of the consumer the retailer is selling to
        string memory smartphoneDetails,  // Details about the smartphone, like color, variant, etc.
        string memory additionalInfo  // Additional info for transaction, such as transaction ID or invoice number
    ) public {
        require(hasRole(RETAILER_ROLE, msg.sender), "Unauthorized!");
        require(passports[_imeiNumber].imeiNumber == _imeiNumber, "IMEI does not exist!");

        string memory eventDescription = string(abi.encodePacked(
            "Transaction Type: Sold to Consumer",
            "\nConsumer Address: ", addressToString(consumerAddress),
            "\nSmartphone Details: ", smartphoneDetails,
            "\nAdditional Info: ", additionalInfo
        ));

        LifecycleEvent memory newEvent = LifecycleEvent({
            eventDescription: eventDescription,
            timestamp: block.timestamp
        });

        passports[_imeiNumber].lifecycleEvents.push(newEvent);
    }


    function governmentTransaction(uint256 _imeiNumber) public view returns (EWastePassport memory) {
        require(hasRole(GOVERNMENT_ROLE, msg.sender), "Unauthorized!");
        return passports[_imeiNumber];
    }

    function environmentTransaction(uint256 _imeiNumber) public view returns (LifecycleEvent[] memory, DisposalEvent memory) {
        require(hasRole(ENVIRONMENT_ROLE, msg.sender), "Unauthorized!");
        require(passports[_imeiNumber].imeiNumber == _imeiNumber, "IMEI does not exist!");

        return (passports[_imeiNumber].lifecycleEvents, passports[_imeiNumber].disposalEvent);
    }

}
